,(103,'POSTFIELD','TEXT_POSITION','<br><span>If yes, some literacy skills may have been used to achieve.</span>',NULL,'LAYER2','1','SKILLSCHECKER','SC2.t',NULL,TIMESTAMP '2012-10-15 17:29:39.000000','SYS',TIMESTAMP '2015-10-16 13:56:06.000000','SYS')
,(104,'POSTFIELD','TEXT_POSITION','<br><span>GCSE Maths/English above C or equivalents (e.g. Key Skills L2, National Lit/Num tests at L2). Other qualifications would indicate some literacy/numeracy skills to achieve.</span>',NULL,'LAYER2','1','SKILLSCHECKER','SC3.t',NULL,TIMESTAMP '2012-10-15 17:29:39.000000','SYS',TIMESTAMP '2015-10-16 13:56:06.000000','SYS')
,(105,'POSTFIELD','TEXT_POSITION','<br><span>Clear indicator of some commitment but not necessarily of Num/Lit skills levels. Some Lit/Num skills may have been gained but no guarantee.</span>',NULL,'LAYER2','1','SKILLSCHECKER','SC4.t',NULL,TIMESTAMP '2012-10-15 17:29:39.000000','SYS',TIMESTAMP '2015-10-16 13:56:06.000000','SYS')
,(106,'POSTFIELD','TEXT_POSITION','<br><span>Use of a PC for games, chat and looking at websites would indicate some literacy skills. Games would also suggest some numeracy skills.</span>',NULL,'LAYER2','1','SKILLSCHECKER','SC7.t',NULL,TIMESTAMP '2012-10-15 17:29:39.000000','SYS',TIMESTAMP '2015-10-16 13:56:06.000000','SYS')
,(107,'POSTFIELD','TEXT_POSITION','<br><span>Confidence in paying bills indicates skills in both literacy - understanding the bill - and in numeracy - confidence in understanding how much to pay and how the bill was calculated.</span>',NULL,'LAYER2','1','SKILLSCHECKER','SC8.t',NULL,TIMESTAMP '2012-10-15 17:29:39.000000','SYS',TIMESTAMP '2015-10-16 13:56:06.000000','SYS')
,(108,'POSTFIELD','TEXT_POSITION','<br><span>Asking for simple written material that should be known is a reasonable indicator of the ability to write, at least for everyday purposes such as form-filling.</span>',NULL,'LAYER2','1','SKILLSCHECKER','SC9.t',NULL,TIMESTAMP '2012-10-15 17:29:39.000000','SYS',TIMESTAMP '2015-10-16 13:56:06.000000','SYS')
,(109,'TOP','TEXT_POSITION','<h6>Guidance</h6>
<h6>If you are using this tool for the first time, you may like to read the overall guidance on the available tools.  There are two tools available - this ''First Move'' tool has been specifically developed for the probation service to be used particularly where time or location requires a short, easy to administer tool.  It is not a skills assessment tool - the DfeS ''Smart Move'' tool is available where a skills assessment needs to be undertaken.  Please see the Intranet for more guidance.</h6>',NULL,'LAYER2','1','SKILLSCHECKER',NULL,NULL,TIMESTAMP '2012-10-15 17:29:39.000000','SYS',TIMESTAMP '2012-10-15 17:29:39.000000','SYS')
,(111,'POSTFIELD','TEXT_POSITION','<br><span>Leaving below 16 is likely to indicate that no courses were completed and may have had several periods of non-attendance leading to low skills levels.</span>',NULL,'LAYER2','1','SKILLSCHECKER','SC1.t',NULL,TIMESTAMP '2012-10-15 17:29:39.000000','SYS',TIMESTAMP '2015-10-16 13:56:06.000000','SYS')
