,(24,'TOP','TEXT_POSITION','<h6>R6 Risk of serious harm to others - full analysis</h6>
<p>To be completed as indicated by R1, R2, R4.4, R5.1 or R8.4.1.  The aim is to use all available information to assess whether the offender is likely to cause serious harm.  Because of the services'' duty of care when assessing risk in relation to staff and prisoners, assessors considering the risk of serious harm to these two groups will be concerned with both serious harm as defined above and harm that is less serious in impact.</p>',NULL,'LAYER1','1','ROSHFULL',NULL,NULL,TIMESTAMP '2012-10-15 17:29:06.000000','SYS',TIMESTAMP '2012-10-15 17:29:06.000000','SYS')
,(35,'BOTTOM','TEXT_POSITION','<p>If you have ticked YES to R2.1 you must complete R7.  IF you have ticked YES to R2.2 you must complete R6, serious harm analysis and, if the identity of the child(ren) is known, R7 as well, unless the reason for doing so is indicated in R5.2</p>',NULL,'LAYER2','1','ROSH','R2.2',NULL,TIMESTAMP '2012-10-15 17:29:12.000000','SYS',TIMESTAMP '2012-10-15 17:29:12.000000','SYS')
,(25,'TOP','TEXT_POSITION','<h6>R10.6 Risk</h6>
<p>The assessor must use the information in R10.1 - R10.5 to indicate how likely the offender is to cause serious harm:</p>
<ul>
<li>to others</li>
<li>to staff and/or prisoners</li>
<li>to themselves</li>
<li>be a risk in respect of escape/abscond</li>
<li>be a risk in respect of control and/or breach of trust</li>
<li>be at risk because of their vulnerability</li>
</ul>
<br>
<h6>PSR Stage:</h6>
<p>Assess both the risk of serious harm the offender poses in the community (including a hostel setting) and the risk the offender might pose if in custody (remand and/or sentenced)</p>
<h6>Community Orders:</h6>
<p>Assess the risk of serious harm the offender poses in the community but if there is evidence to indicate that they could pose a risk to anyone in prison this must be used in assessing the level of risk of serious harm.</p>
<h6>Custody:</h6>
<p>Assess the risk of serious harm the offender poses on the basis that they could <strong>be released imminently back into the community</strong>.  The length of the sentence left to serve is not relevant to completion of this section.</p>
<p>Assess both the risk of serious harm the offender presents now, in custody, and the risk they could present to others whilst in a custodial setting.</p>
<p><strong>Low risk of serious harm</strong> - current evidence does not indicate likelihood of serious harm.</p>
<p><strong>Medium risk of serious harm</strong> - there are identifiable indicators of risk of serious harm.  The offender has the potential to cause serious harm but is unlikely to do so unless there is a change in circumstances, for example, failure to take medication, loss of accommodation, relationship breakdown, drug or alcohol misuse.</p>
<p><strong>High risk of serious harm</strong> - there are identifiable indicators of risk of serious harm.  The potential event could happen at any time and the impact would be serious.</p>
<p><strong>Very High risk of serious harm</strong> - there is an imminent risk of serious harm.  The potential event is more likely than not to happen imminently and the impact would be serious.</p>
<p>Where an individual is assessed as being at <strong>medium, high or very high</strong> risk of serious harm, this MUST be followed through with a risk management plan.</p>
',NULL,'LAYER1','1','ROSHSUM','SUM6',NULL,TIMESTAMP '2012-10-15 17:29:07.000000','SYS',TIMESTAMP '2012-10-15 17:29:07.000000','SYS')
,(26,'TOP','TEXT_POSITION','<p>Summarise the risks you have identified in R6-R9.  Consider both <strong><em>current</em></strong> and <strong><em>future</em></strong> risks.  Include risks while the offender is in custody as well as on release.  R11 should also be completed in the Risk Management section.</p>
