,(187,'TOP','TEXT_POSITION','<h6>Guidance</h6>
<h6>If you are using this tool for the first time, you may like to read the overall guidance on the available tools.  There are two tools available - this ''First Move'' tool has been specifically developed for the probation service to be used particularly where time or location requires a short, easy to administer tool.  It is not a skills assessment tool - the DfeS ''Smart Move'' tool is available where a skills assessment needs to be undertaken.  Please see the Intranet for more guidance.</h6>',NULL,'LAYER3','1','SKILLSCHECKER',NULL,NULL,TIMESTAMP '2012-10-15 17:30:12.000000','SYS',TIMESTAMP '2012-10-15 17:30:12.000000','SYS')
