<p>Assess the risk of serious harm the offender poses on the basis that they could <strong>be released imminently back into the community</strong>.  The length of the sentence left to serve is not relevant to completion of this section.</p>
<p>Assess both the risk of serious harm the offender presents now, in custody, and the risk they could present to others whilst in a custodial setting.</p>
<p><strong>Low risk of serious harm</strong> - current evidence does not indicate likelihood of serious harm.</p>
<p><strong>Medium risk of serious harm</strong> - there are identifiable indicators of risk of serious harm.  The offender has the potential to cause serious harm but is unlikely to do so unless there is a change in circumstances, for example, failure to take medication, loss of accommodation, relationship breakdown, drug or alcohol misuse.</p>
<p><strong>High risk of serious harm</strong> - there are identifiable indicators of risk of serious harm.  The potential event could happen at any time and the impact would be serious.</p>
<p><strong>Very High risk of serious harm</strong> - there is an imminent risk of serious harm.  The potential event is more likely than not to happen imminently and the impact would be serious.</p>
<p>Where an individual is assessed as being at <strong>medium, high or very high</strong> risk of serious harm, this MUST be followed through with a risk management plan.</p>
